import React from 'react';
import Link from 'next/link';
import searchContainer from '../containers/SearchContainer';
import search from '../components/search';

const indexPage = () => {
    return (
        <div>
          <searchContainer />
          <search />
        </div>
    )
}

export default indexPage;
